document.addEventListener("DOMContentLoaded",(e=>{document.querySelectorAll(".btn-text-delete-resume").forEach((e=>{e.addEventListener("click",(e=>{e.preventDefault();let t=e.target.href.split("/"),n=t[t.length-1];window.confirm("Do you want to delete this Resume?")&&fetch(`/deleteResume/${n}`,{method:"DELETE"}).then((e=>e.json())).then((e=>{e.success&&(window.location.href="/resumes")}))}))}))}));